import React, { useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { Navigate } from "react-router-dom";
import { openModal } from "../../../layouts/components/modals/ModalPopUp";

export default function FormProfile() {
  var today = new Date();
  const currDate = formatDate(today);
  const objProfile = {
    npm: "",
    fname: "",
    mname: "",
    lname: "",
    birthdate: currDate,
  };

  const [profile, setProfile] = useState(objProfile);
  const [successSubmit, setSuccseesSubmit] = useState(false);

  const handlerSubmit = (e) => {
    e.preventDefault();
    var formid = e.target.id;
    var target = document.getElementById(formid);
    var myButton = target.getElementsByClassName("btn-submit")[0];
    myButton.textContent = "Processing...";
    myButton.disabled = true;
    if (profile.npm && profile.fname && profile.lname && profile.birthdate) {
      openModal({
        header: "Information",
        message: <RenderMessage profile={profile} />,
      });
      setSuccseesSubmit(true);
    } else {
      openModal({
        header: "Information",
        message: (
          <p className="text-danger">Please fukk up the form with correctly</p>
        ),
      });
    }
    myButton.textContent = "Submit";
    myButton.disabled = false;
  };

  return successSubmit ? (
    <Navigate to="/home" replace={true} />
  ) : (
    <div className="card ">
      <div className="card-header">
        <h3 className="card-title align-items-start flex-column">
          <span className="card-label fw-bolder text-dark">
            Form add data user
          </span>
          <span className="text-gray-400 mt-1 fw-bold fs-6">
            Please fill up the form with correctly
          </span>
        </h3>
      </div>
      <div className="card-body">
        <form
          className="form-profile"
          method="post"
          onSubmit={(e) => handlerSubmit(e)}
          id="form-profile"
        >
          <div className="fv-row mb-10 fv-plugins-icon-container">
            <label className="required form-label fs-6 fw-bolder text-dark">
              NPM
            </label>
            <input
              type="text"
              name="npm"
              //   required
              className="form-control form-control-lg form-control-solid"
              pattern="^[0-9]*$"
              defaultValue={profile.npm}
              onChange={(e) => setProfile({ ...profile, npm: e.target.value })}
            />
          </div>

          <div className="fv-row mb-10 fv-plugins-icon-container">
            <label className="required form-label fs-6 fw-bolder text-dark">
              First Name
            </label>
            <input
              type="text"
              name="fname"
              //   required
              className="form-control form-control-lg form-control-solid"
              defaultValue={profile.fname}
              onChange={(e) =>
                setProfile({ ...profile, fname: e.target.value })
              }
            />
          </div>
          <div className="fv-row mb-10 fv-plugins-icon-container">
            <label className="form-label fs-6 fw-bolder text-dark">
              Middle Name
            </label>
            <input
              type="text"
              name="mname"
              className="form-control form-control-lg form-control-solid"
              defaultValue={profile.mname}
              onChange={(e) =>
                setProfile({ ...profile, mname: e.target.value })
              }
            />
          </div>
          <div className="fv-row mb-10 fv-plugins-icon-container">
            <label className="required form-label fs-6 fw-bolder text-dark">
              Last Name
            </label>
            <input
              type="text"
              name="lname"
              required
              className="form-control form-control-lg form-control-solid"
              defaultValue={profile.lname}
              onChange={(e) =>
                setProfile({ ...profile, lname: e.target.value })
              }
            />
          </div>
          <div className="fv-row mb-10 fv-plugins-icon-container">
            <label className="required form-label fs-6 fw-bolder text-dark">
              Birthdate
            </label>
            <DatePicker
              selected={new Date(profile.birthdate)}
              onChange={(value) =>
                setProfile({ ...profile, birthdate: formatDate(value) })
              }
              className="form-control form-control-lg form-control-solid"
              dateFormat="yyyy-MM-dd"
              placeholderText="Choose Date"
            />
          </div>

          <div className="text-center mt-3">
            <button type="button" className="btn btn-lg btn-light">
              Clear
            </button>
            <button
              type="submit"
              className="btn btn-lg btn-primary mx-2 btn-submit"
            >
              Submit
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}

const formatDate = (datestring) => {
  const today = new Date(datestring);
  const yyyy = today.getFullYear();
  let mm = today.getMonth() + 1; // Months start at 0!
  let dd = today.getDate();

  if (dd < 10) dd = "0" + dd;
  if (mm < 10) mm = "0" + mm;

  return yyyy + "-" + mm + "-" + dd;
};

const calculateAge = (birthdate) => {
  var today = new Date();
  var birthDate = new Date(birthdate);
  var age = today.getFullYear() - birthDate.getFullYear();
  var m = today.getMonth() - birthDate.getMonth();
  if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
    age--;
  }
  return age;
};

const RenderMessage = ({ profile }) => {
  return (
    <div className="profile">
      <p className="text-dark">NPM: {profile.npm}</p>
      <p className="text-dark">
        Fullname: {profile.fname} {profile.mname} {profile.lname}{" "}
      </p>
      <p className="text-dark">Birthdate: {profile.birthdate}</p>
      <p className="text-dark">
        Age: {calculateAge(profile.birthdate)} years old
      </p>
    </div>
  );
};
